  true,\n\t\"url\": null,\n\t\"notes\": \"This product brings together 1960-2012 data
  on fertilizer consumption in the United States by plant nutrient and major selected
  product, as well as consumption of mixed fertilizers, secondary nutrients, and micronutrients.
  Share of crop area receiving fertilizer and fertilizer use per receiving acre, by
  nutrient, are presented for the major producing States for corn, cotton, soybeans,
  and wheat. Additional data include fertilizer farm prices and indices of wholesale
  fertilizer price. Fertilizer price data are through 2013.\",\n\t\"license_title\":
